vidade/execution", "children": [{"type": "file", "name": "Execution.ipynb", "path": "Teste-Conectividade/execution/Execution.ipynb", "nb_html": "Teste-Conectividade/execution/Execution.html"}]}, {"type": "dir", "name": "pricing", "path": "Teste-Conectividade/pricing", "children": [{"type": "file", "name": "Pricing.ipynb", "path": "Teste-Conectividade/pricing/Pricing.ipynb", "nb_html": "Teste-Conectividade/pricing/Pricing.html"}]}, {"type": "file", "name": "quantum-task.ipynb", "path": "Teste-Conectividade/quantum-task.ipynb", "nb_html": "Teste-Conectividade/quantum-task.html"}, {"type": "file", "name": "requirements.txt", "path": "Teste-Conectividade/requirements.txt"}]}, {"type": "file", "name": "requirements.txt", "path": "requirements.txt"}, {"type": "dir", "name": "scripts", "path": "scripts", "children": [{"type": "file", "name": "build_site.py", "path": "scripts/build_site.py"}]}]};  // JSON com a árvore
const elTree = document.getElementById('tree');
const q = document.getElementById('q');

function mkNode(node) {
  const li = document.createElement('li');
  li.className = 'node ' + (node.type === 'dir' ? 'dir' : 'file');
  const label = document.createElement('span');
  label.className = 'label';

  if (node.type === 'dir') {
    label.textContent = node.name;
    label.onclick = () => li.classList.toggle('open');
    li.appendChild(label);
    const ul = document.createElement('ul');
    ul.className = 'children';
    node.children.forEach(ch => ul.appendChild(mkNode(ch)));
    li.appendChild(ul);
  } else {
    if (node.nb_html) {
      const a = document.createElement('a');
      a.textContent = node.name;
      a.href = "#";
      a.className = 'file-notebook';
      a.onclick = (e) => {
        e.preventDefault();
        document.getElementById('viewer').src = node.nb_html;
      };
      label.appendChild(a);
    } else {
      label.textContent = node.name;
    }
    li.appendChild(label);
  }
  return li;
}

function render(filter='') {
  elTree.innerHTML = '';
  const norm = s => s.toLowerCase();
  function pass(node) {
    if (!filter) return true;
    return norm(node.name).includes(filter) || (node.path && norm(node.path).includes(filter));
  }
  function cloneFiltered(node) {
    if (node.type === 'file') return pass(node) ? node : null;
    const kids = node.children.map(cloneFiltered).filter(Boolean);
    if (kids.length) return {...node, children:kids};
    return pass(node) ? {...node, children:[]} : null;
  }
  const filtered = cloneFiltered(data);
  if (!filtered) {
    elTree.innerHTML = '<li class="node">Nada encontrado…</li>';
    return;
  }
  filtered.children.forEach(ch => elTree.appendChild(mkNode(ch)));
}

q.addEventListener('input', (e) => render(e.target.value.trim().toLowerCase()));
render();
